import React, { Component } from 'react';


const Product = (props) => {
    return (
        <div>
            <h2>{props.product.title} - {props.product.price}$</h2>
            <img src={props.product.img}></img>
        </div>
    );
}

const Title = (props) => {
    return ( 
    <h2>
        {props.name} {props.title}
    </h2>
    );
}

export default Product;
